INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3256224191384', 'Pâte feuilletée au beurre', 'Farine de blé, eau, beurre concentré alcool éthylique, sel, jus de citron concentré, levure désactivée. Certains ingrédients de ce produit ne proviennent pas de France. Conseils de préparation : Sortez la pâte du réfrigérateur 5 minutes avant utilisation. Préchau(+ez votre four à 2200C (Th.7) pendant 15 minutes environ. Déroulez la pâte avec sa feuille de cuisson et disposez-la dans son moule. Découpez les excédents de papier. Foncez les bords et piquez le fond avec une fourchette. Ajoutez la garniture de votre choix. Faites cuire 30 à 35 minutes à 180-2000C (Th. 6). Le temps de cuisson peut varier en fonction de la coloration dorée de la pâte. Consetvaüon : Doit être conservé entre OOC et +60C. Conditionné sous atmosphère protectrice. A consommer jusqu\'au : voir sur l\'emballage.', '', '20', '14', '43', '2', '1.3', '6.3', '0.53', '0.208661417322835', '', '1');

