VALUES ('3256224354963', 'Bâtonnets crème brûlée U', 'Glace saveur crème brûlée 53,2% : LAIT écrémé réhydraté (France), eau, sucre, graisse végétale de coprah, sirop de glucose-fructose, sirop de glucose, LACTOSE et protéines de LAIT, émulsifiant : mono- et diglycérides d\'acides gras, gélifiants : farine de graines de caroube - gomme guar, arôme naturel, arôme naturel de vanille, colorant : caroténoïdes. Enrobage chocolat blanc 28,4% : sucre, beurre de cacao, poudre de LACTOSERUM, matière grasse LAITIÈRE anhydre, poudre de LAIT écrémé, émulsifiants : lécithine de SOJA -  polyricinoléate de polyglycérol, arôme naturel de vanille. Sauce caramel 8,5% : sirop de glucose, LAIT entier concentré sucré, eau, beurre de cacao, CRÈME, sucre brun, BEURRE, sel, émulsifiant : mono- et diglycérides d\'acides gras, épaississant : pectines, sucre, arôme naturel. Brisures de caramel 5,7% : sucre, beurre de cacao, eau. Morceaux d\'amandes 4,2% : AMANDES grillées. Certains ingrédients de ce produit ne proviennent pas de France Traces éventuelles de gluten, oeuf, arachide et autres fruits à coque.', '', '20.8', '13.4', '38.7', '35.3', '0.6', '3.2', '0.23', '0.0905511811023622', '', '0');

