VALUES ('3256224354987', 'Bâtonnets folie de chocolat noisette', 'Glace chocolat-noisette 38,9% : eau, LAIT écrémé réhydraté (France), sucre, sirop de glucose-fructose, graisse végétale de coprah, LACTOSE et protéines de LAIT, chocolat noir 3,5%* (pâte de cacao 44%, sucre, poudre de cacao maigre 21%, émulsifiant : lécithine de SOJA), poudre de cacao 2,7%*, pâte de noisette 2%*, sirop de glucose, poudre de cacao maigre 0,6%*, émulsifiants : mono- et diglycérides d\'acides gras - esters lactiques des mono- et diglycérides d\'acides gras, gélifiants : farine de graine de caroube - gomme guar. *(Pourcentage exprimé sur la glace chocolat-noisette). Enrobage chocolat au lait 30,5% : sucre, beurre de cacao, poudre de LACTOSERUM, matière grasse LAITIÈRE anhydre, pâte de cacao 6%*, poudre de LAIT écrémé, émulsifiants : lécithine de SOJA - polyricinoléate de polyglycérol. *(Pourcentage exprimé sur l\'enrobage au chocolat au lait). Glace praliné 26% : LAIT écrémé réhydraté, sucre, praliné 6%* (pâte de noisette, sucre), sirop de glucose-fructose, graisse végétale de coprah, poudre de LACTOSERUM, eau, émulsifiants : mono- et diglycérides d\'acides gras - esters lactiques des mono- et diglycérides d\'acides gras, gélifiants : farine de graine de caroube - gomme guar, colorant : caramel ordinaire, poudre de cacao maigre. *(Pourcentage exprimé sur la glace praliné). Morceaux de noisettes caramélisées 4,6% : noisettes 70%*, sucre. *(Pourcentage exprimé sur les morceaux de noisettes caramélisées).  Traces éventuelles de gluten, oeuf, arachide et autres fruits à coque.', '', '20.3', '12.3', '33.3', '31.1', '1.4', '3.6', '0.12', '0.047244094488189', '', '0');

