INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3256224355007', 'Bâtonnets folie de chocolat', 'Glace au chocolat 47,6% : LAIT écrémé réhydraté (France), eau, sirop de glucose-fructose, sucre, graisse végétale de coprah, poudres de cacao maigre 3%*, LACTOSE et protéines de LAIT, chocolat noir 2%* (pâte de cacao 44%, sucre, poudre de cacao maigre 21%, émulsifiant : lécithine de SOJA), pâte de cacao 1%*, sirop de glucose, émulsifiant : mono- et diglycérides d\'acides gras, gélifiants : farine de graines de caroube - gomme guar, arôme naturel. *(Pourcentage exprimé sur la glace au chocolat). Enrobage chocolat noir 27,6% : sucre, pâte de cacao 33%*, beurre de cacao, matière grasse LAITIÈRE anhydre, émulsifiant : polyricinoléate de polyglycérol. *(Pourcentage exprimé sur l\'enrobage chocolat noir). Enrobage sauce au chocolat 24,8% : LAIT écrémé réhydraté, sirop de glucose-fructose, chocolat en poudre 9%* (sucre, poudre de cacao), eau, sucre, poudre de cacao maigre 1%*, gélifiant : carraghénanes, antimoussant : mono- et diglycérides d\'acides gras, sel. *(Pourcentage exprimé sur l\'enrobage de sauce au chocolat). Certains ingrédients de ce produit ne proviennent pas de France. Traces éventuelles de gluten, oeuf, arachide et fruits à coque.', '', '17.3', '12', '33.5', '29.4', '2.7', '2.9', '0.08', '0.031496062992126', '', '0');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
